IVE','ADDRESS','2014-11-24 22:40:07','2015-02-07 22:41:38'),(106,1,'Address_1416861548312_AddressLine3',NULL,'121212121','ACTIVE','ADDRESS','2014-11-24 22:40:07','2015-02-07 22:41:38'),(107,1,'Address_1416861548312_Phone_contact1416861575266','Телефон','032 111 111 11','ACTIVE','ADDRESS','2014-11-24 22:40:08','2015-02-07 22:41:38'),(108,1,'Address_1416861548312_AddressLine1',NULL,'Lviv','ACTIVE','ADDRESS','2014-11-24 22:40:08','2015-02-07 22:41:38'),(109,1,'Address_1416861548312_OpenHoursOnWed',NULL,'00:00 - 00:00','ACTIVE','ADDRESS','2014-11-24 22:40:08','2015-02-07 22:41:38'),(110,1,'Address_1416861548312_OpenHoursOnTue',NULL,'00:00 - 00:00','ACTIVE','ADDRESS','2014-11-24 22:40:08','2015-02-07 22:41:38'),(111,1,'Address_1416861548312_AddressLine2',NULL,'asasasasa','ACTIVE','ADDRESS','2014-11-24 22:40:08','2015-02-07 22:41:38'),(112,1,'Address_1416861548312_OpenHoursOnMon',NULL,'08:30 - 18:00','ACTIVE','ADDRESS','2014-11-24 22:40:08','2015-02-07 22:41:38'),(113,1,'Address_1416861548312_OpenHoursOnSat',NULL,'00:00 - 00:00','ACTIVE','ADDRESS','2014-11-24 22:40:09','2015-02-07 22:41:39'),(114,1,'Address_1416861548312_Shipping',NULL,'<span>ОПЛАТА ТА ДОСТАВКАНаш інтернет магазин – це великий вибір побутової техніки за приємними та низькими цінами! Також у нас є постійно діючі Акції та Гарячі пропозиції за не менш гарячими цінами.Ми зацікавлені у довготривалій та плідній співпраці із Вами тому пропонуємо різноманітні способи оплати та доставки техніки.Як оплатити товар?<ol><li>Оплачуйте товар в найближчому до Вас офісі транспортної компанії \"Нова Пошта\" яка є нашим партнером у питаннях доставки. Ми надаємо можливість оплатити замовлену техніку безпосередньо під час її отримання на складі транспортної компанії. Жодного ризику для Вас! Ви сплачуєте за покупку на місці при отриманні товару і маєте можливість його оглянути та перевірити комплектацію!&nbsp; (додатково сплачується страхування різниці курсів у розмірі &nbsp;7% до загальної вартості товару).</li><li>Ви можете оплатити товар у два етапи: перший етап ви сплачуєте 50% вартості товару на рахунок, другий етап 50% при отриманні &nbsp;готівкою по курсу на день відправки товару &nbsp;(додатково сплачується страхування різниці курсів у розмірі &nbsp;7% до залишкової суми товару)</li><li>100% передоплата на рахунок по курсу на день оплати.</li><li>Ви можете оплатити товар готівкою при самовивозі товару.</li><li>Ми можемо надіслати товар до вас без жодних попередніх оплат. Ви маєте змогу оплатити даний товар після того як він прибув у ваше місто. (Дана послуга здійснюється лише через перевізника “Delivery”.</li><li>Ви можете оплатити замовлену техніку безпосередньо кур\'єру який доставить її за вказаною адресою у найбільш зручний для Вас час. Кур\'єрська доставка здійснюється на платній основі. Про вартість кур\'єрської доставки ви можете дізнатись нижче.</li></ol>Ми надаємо можливість оплатити техніку скориставшись послугами найближчого до Вас банку здійснивши переказ коштів на зазначений банківський рахунок. Рахунок Ви можете одержати найбільш зручним для Вас способом: по СМС або електронною поштою.<span>Кур\'єрська доставка товарів у будь-який населений пункт України&nbsp;<br>Доставка здійснюється у робочий час з 9:00 до 18:00.&nbsp;<br>Термін доставки від 1 до 5 днів (в залежності від міста доставки)&nbsp;<br>Перед здійсненням доставки кур\'єр обов\'язково узгодить з Вами зручний час доставки. Кур\'єрська доставка здійснюється за вказаною адресою до будинку чи під під\'їзд будинку.&nbsp;<br><br>Вартість доставки залежить від ваги і об\'єму вантажу нижче наведена вартість:&nbsp;<br><br>ДОСТАВКА ПО ЛЬВОВУ І ОБЛАСТІ&nbsp;<br>Протягом однієї години з часу поступлення замовлення (з 9.00 до 19.00) менеджер зв\'язується з Вами щоб звірити кількість та вартість замовлених товарів.&nbsp;<br>ДАТУ ЧАС ТА АДРЕСУ місця доставки замовлення менеджер узгоджує безпосередньо з покупцем.&nbsp;<br>Вартість доставки:&nbsp;<br>- вартість доставки по домовленості.&nbsp;<br>-доставка здійснюється до під’їзду.&nbsp;<br>При наявності вантажного ліфту підйом товару на поверх рахується за ціною підйому на 2-й поверх без ліфту.</span><span>При відсутності вантажного ліфту підйом товару на поверх здійснюється за наступними тарифами:&nbsp;<br></span></span><ul><li>товар вагою менше 20 кг — безкоштовно;&nbsp;</li><li>товар вагою 21-50 кг. – 15 грн. / поверх;&nbsp;</li><li>товар вагою 51-70 кг. – 20 грн. / поверх;</li><li>товар вагою більше 71кг. – 30 грн. / поверх.&nbsp;</li><li>вартість доставки за межі Львова розраховується відповідно до тарифу: 1км = 10 грн.&nbsp;</li></ul><span><span><br>Зверніть увагу!&nbsp;Служба доставки не проводить підключення інструктажу установок чи налаштування техніки що доставляється. Всі питання пов’язані з додатковими послугами з підготовки товару до роботи та запуском тієї чи іншої техніки обговорюються з менеджером.</span>Запам’ятайте:&nbsp;1. При отриманні техніки необхідно мати при собі документ що засвідчує особу (паспорт або водійське посвідчення) та мати номер декларації про відправку техніки (його повідомляє менеджер після відправки товару СМС повідомленням).&nbsp;2. Одержуючи техніку на складі транспортної компанії уважно розглянете її переконаєтеся у відсутності будь - яких механічних пошкоджень перевірте працездатність ручок клямок інших механічних вузлів наявність і правильність заповнення документів. Пам\'ятаєте що претензії щодо зовнішнього вигляду доставленого Вам товару Ви можете пред\'явити лише до передачі його Вам кур\'єром. В усіх інших випадках претензії щодо механічних пошкоджень і комплектації не братимуться до уваги.<div><br></div></span>','ACTIVE','ADDRESS','2014-11-24 22:40:09','2015-02-07 22:41:39'),(115,1,'Address_1416861548312_OpenHoursOnFri',NULL,'00:00 - 00:00','ACTIVE','ADDRESS','2014-11-24 22:40:09','2015-02-07 22:41:38'),(116,1,'Address_1416861548312_OpenHoursOnThu',NULL,'00:00 - 00:00','ACTIVE','ADDRESS','2014-11-24 22:40:09','2015-02-07 22:41:38'),(117,1,'Address_1416861548312_OpenHoursOnSun',NULL,'00: